import * as WebBrowser from 'expo-web-browser';
import React from 'react';
import { StyleSheet, SafeAreaView, TextInput, Button } from 'react-native';

import { Text, View } from './Themed';

import { withAuthenticator } from 'aws-amplify-react-native';

// import { Auth } from 'aws-amplify';


// import TabChat from '../screens/TabChat';

import Components_SingOut from './Components_SingOut';


function Components_Login({ path }: { path: string }) {

  const [message, onChangeMessage] = React.useState('');

  return (
    <View>
      <Components_SingOut path="/screens/Components_Login.tsx"/>
      <SafeAreaView>
        <Text style={styles.title}>Message</Text>
        <View>
        <TextInput
        multiline={true}
        numberOfLines={1}
        style={styles.input}
        onChangeText={Text => onChangeMessage(Text)}
        placeholder="Message"
        />
        <Text>{message}</Text>
        </View>
        <Button
          onPress={sendMessage}
          title="Send message"
          color="#ff9900" />
      </SafeAreaView>
    </View>
  );
}

function sendMessage() {
  console.log("Send Message....")
}


const styles = StyleSheet.create({
  title: {
    fontSize: 30,
    fontWeight: 'bold',
    textAlign: 'center',
    paddingTop: 60,
    paddingBottom: 20,
  },
  input: {
    height: 40,
    margin: 12,
    borderWidth: 1,
    padding: 10,
  },
});


export default withAuthenticator(Components_Login);
// export default Components_Login;
